# Преобразование ЗВУКА в ТЕКСТ
def transcribe(audioFile):
    try:
        saved_time = time.perf_counter()  # Текущее время для оценки времени работы
        model = whisper.load_model('tiny')
        result = model.transcribe(audioFile, fp16=False)

        # segments = result['segments']
        # print(result['text'], "\n")
        # if findAds(result['text']):
        #     return result['segments']
        # else:
        #     return False

        print(f'Finished Transcribing [{round(time.perf_counter() - saved_time, 1)}sec | {result["segments"][-1]["end"]}sec]\n')  # Время выполнения

        return result['segments']

    except:
        print("Failed to transcribe audio")
        return


# Стандартизация сегментов (каждый примерно по 10 секунд)
def normalizeSegments(segments):

    new_segments = []
    temp_segment = {'start': 0, 'end': 0, 'text': ''}

    for s in segments:

        if s['end'] - s['start'] <= 10:  # Если длина текущего сегмента < 10сек

            if temp_segment['end'] - temp_segment['start'] <= 10:  # Если длина временного сегмента < 10сек

                if temp_segment['start'] == 0:  # Если временный сегмент еще не начат
                    temp_segment['start'] = s['start']  # Присваиваем ему СТАРТ

                temp_segment['end'] = s['end']  # Присваиваем ему КОНЕЦ
                temp_segment['text'] += s['text']  # Добавляем текст текущего сегмента во временный сегмент

            else:  # Если временный сегмент уже заполнен (> 10сек)
                new_segments.append(temp_segment)  # Добавляем временный сегмент в новый список
                temp_segment = {'start': s['start'], 'end': s['end'], 'text': s['text']}  # Обнуляем временный сегмент

        else:
            new_segments.append({'start': s['start'], 'end': s['end'], 'text': s['text']})

    return new_segments


# Добавление в список только уникальных элементов (дубликаты полностью недопустимы)
def listWithoutDuplicates(element, list_set):
    if element not in list_set:
        list_set.append(element)
    else:
        list_set = [x for x in list_set if x != element]
    return list_set


# Анализ текста на наличие рекламы
def searchTextAds(segments_list, triggers_A, triggers_B, triggers_C):

    result_timings = []

    # triggers_A = ['описан', 'ссылка', 'промокод']
    # triggers_B = ['скидк', 'бонус']
    # triggers_C = ['хочу', 'рекоменд']

    keepChain_B = False
    keepChain_C = False

    for segment in reversed(segments_list):

        text = segment['text'].lower()

        if any(word in text for word in triggers_A):
            result_timings = listWithoutDuplicates(segment['start'], result_timings)
            result_timings = listWithoutDuplicates(segment['end'], result_timings)
            keepChain_B = True
            keepChain_C = False

        elif any(word in text for word in triggers_B) and keepChain_B:
            result_timings = listWithoutDuplicates(segment['start'], result_timings)
            result_timings = listWithoutDuplicates(segment['end'], result_timings)
            keepChain_C = True

        elif any(word in text for word in triggers_C) and keepChain_C:
            result_timings = listWithoutDuplicates(segment['start'], result_timings)
            result_timings = listWithoutDuplicates(segment['end'], result_timings)

        else:
            keepChain_B = False
            keepChain_C = False

    result_timings.reverse()
    return result_timings


